import React, { useState, useEffect } from 'react';
import { useParams } from 'react-router-dom';

function Employequestion() {
  const [application, setApplication] = useState(null); // Store application details
  const { _id } = useParams(); // Fetch the application ID from URL params
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState(null);

  useEffect(() => {
    if (!_id) {
      setError('Application ID is missing');
      setLoading(false);
      return;
    }

    const fetchApplication = async () => {
      try {
        const response = await fetch(`http://localhost:8080/apply-candidate-detail/${_id}`, {
          method: 'GET',
          headers: {
            'Content-Type': 'application/json',
          },
          credentials: 'include',
        });

        if (!response.ok) {
          throw new Error('Error fetching application data');
        }

        const data = await response.json();
        setApplication(data);
      } catch (err) {
        setError(err.message || 'Error fetching application details');
      } finally {
        setLoading(false);
      }
    };

    fetchApplication();
  }, [_id]);

  if (loading) {
    return <div>Loading...</div>;
  }

  if (error) {
    return <div>{error}</div>;
  }

  return (
    <>
      <div className="wt-admin-right-page-header clearfix">
        <h2>Questions and Answers</h2>
        <div className="breadcrumbs">
          <a href="#">Home</a>
          <a href="#">Dashboard</a>
          <span>Question and Answer</span>
        </div>
      </div>

      <div className="application-details">
        {application ? (
          <div className="application-card">
            <h3>Job Title: {application.JobId?.jobtitle || 'N/A'}</h3>
            <p><strong>Job Category:</strong> {application.JobId?.jobcategory || 'N/A'}</p>
            <p><strong>Job Type:</strong> {application.JobId?.j || 'N/A'}</p>
            <p><strong>Offered Salary:</strong> {application.offeredsalary || 'N/A'}</p>
            <hr />
            <div className="questions-and-answers">
              {Array.isArray(application.questionsAndAnswers) && application.questionsAndAnswers.length > 0 ? (
                application.questionsAndAnswers.map((qa, idx) => (
                  <div key={idx} className="qa-item">
                    <p>
                      <strong>Q{idx + 1}:</strong> {qa.question}
                    </p>
                    <p>
                      <strong>A{idx + 1}:</strong> {qa.answer || 'No answer provided'}
                    </p>
                    {qa.video?.upload?.filename && (
                      <div className="video-preview">
                        <p><strong>Video:</strong></p>
                        <video
                          controls
                          src={`http://localhost:8080/uploads/candidate/videoanswer/${qa.video.upload.filename}`}
                          style={{ width: '100%', maxWidth: '500px' }}
                        >
                          Your browser does not support the video tag.
                        </video>
                      </div>
                    )}
                  </div>
                ))
              ) : (
                <p>No questions or answers available.</p>
              )}
            </div>
          </div>
        ) : (
          <div>No application details available.</div>
        )}
      </div>
    </>
  );
}

export default Employequestion;
